import { AppBar } from "@mui/material";
import { Box } from '@mui/material';

export default function Header () {

    return (
        <Box sx={{ flexGrow: 1 }}>
       <AppBar position="static">
       <Toolbar>
       <IconButton
            size="large"
            edge="start"
            color="inherit"
            aria-label="menu"
            sx={{ mr: 2 }}
          >
            <MenuIcon />
          </IconButton>

</Toolbar>
    </AppBar>
    </Box>
       
    );

}
